import React from 'react'
import { HeroList } from '../heroes/HeroList'

export const DcScreen = () => {
    return (
        <div>
            <h1>DC Screen</h1>
            <hr></hr>
            <HeroList publisher='DC Comics'/>
        </div>
    )
}
